import React, { useEffect, useState } from "react";
import Moviebox from "./Moviebox";
import "./Movies.css";
import axios from "axios";
function Movies() {
  const [movies, setMovies] = useState([]);
  const API_URL =
    "https://api.themoviedb.org/3/trending/movie/day?api_key=da5ab5b5b2a262c4362af18406224e09";
  useEffect(() => {
    axios
      .get(API_URL)
      .then((response) => {
        console.log(response.data.results);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <>
      <section className="movies">
        {movies.map((movie, index) => {
          return <Moviebox key={index} {...movie} />;
        })}
      </section>
    </>
  );
}

export default Movies;
